{"source":{"uri":"features\/catalogo.feature","data":"#language: pt\n\nFuncionalidade: Catálogo de cafés\n    Como um usuário do site, eu quero ver o catálogo de cafés na página principal\n    Para que eu possa escolher e saber mais sobre os produtos disponíveis\n\nCenário: Acessar o catálogo de cafés na página principal\n\n    Quando acesso a página principal da Starbugs\n    Então eu devo ver uma lista de cafés disponíveis\n\n\nCenário: Iniciar a compra de um café\n\n    Dado que estou na página principal da Starbugs\n        E que desejo comprar o seguinte produto:\n        | name            | Expresso Gelado |\n        | price           | R$ 9,99         |\n        | delivery        | R$ 10,00        |\n\n        #Exemplo para utilizar quando tiver mais de um produto a ser testado\n        #| product         | price   | delivery |\n        #| Expresso Gelado | R$ 9,99 | R$ 10,00 |\n        #| Expresso Gelado | R$ 9,99 | R$ 10,00 |\n        #| Expresso Gelado | R$ 9,99 | R$ 10,00 |\n    Quando inicio a compra desse item\n    Então devo ver a página de checkout com os detalhes do produto\n        E o valor total da compra deve ser de \"R$ 19,99\"\n@temp\nCenário: Café indisponível\n\n    Dado que estou na página principal da Starbugs\n        E que desejo comprar o seguinte produto:\n        | name            | Expresso Cremoso |\n    Quando inicio a compra desse item\n    Então devo ver um popup informando que o produto está indisponível","mediaType":"text\/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features\/pedido.feature","data":"#language: pt\n\nFuncionalidade: Pedidos\n\n    Como um usuário do site Starbugs, eu quero selecionar e comprar cafés\n    Para que eu possa receber os produtos em meu endereço e efetuar o pagamento na entrega.\n\n    Cenário: Compra bem sucedida\n\n        Dado que estou na página principal da Starbugs\n            E que iniciei a compra do item \"Expresso Tradicional\"\n        Quando faço a busca do seguinte CEP: \"31560420\"\n            E informo os demais dados do endereço:\n                | number      |100     |\n                | details     |Apto 101|\n            E escolho a forma de pagamento \"Cartão de Débito\"\n            E por fim finalizo a compra\n        Então sou redirecionado para a página de confirmação de Pedidos\n            E deve ser informado o seguinte prazo de entrega: \"20 min - 30 min\"","mediaType":"text\/x.cucumber.gherkin+plain"}},
